import React from 'react';
import * as FaIcons from 'react-icons/fa';
import { Link } from 'react-router-dom';

function NavBar() {
  return;
  <>
    <div className="navbar">
      <Link to="#" className="menu-bars">
        <FaIcons.FaBars />
        <h1>Test</h1>
      </Link>
    </div>
  </>;
}

export default NavBar;
